import styled from "styled-components"

export const Container = styled.nav`
    position: relative;
    display: flex;
    justify-content: center;
    height: 100vh;
    width: 100vw;
    box-sizing: border-box;


    a{
        text-decoration: none;
        font-size: 1.1rem;
        color: white;

    }

    a:hover {
        cursor: pointer;
        color: grey;
    }

    div {
       margin: auto 1rem auto 1rem;

    }

    .links {
        display: flex;
        justify-content: space-between;
        width: 40rem;

    }

    .login-img {
        width: 2.25rem;
        height: 2rem;
        border-radius: 50%;

    }

    .logo-img {
        width: 2.25rem;
        height: 2.25rem;
        border-radius: 50%;

    }
`;
